Most of Metis development libraries are composed of contract components. In Solidity, the introduction of contract components can be implemented based on inheritance. Generally, the contract components will include the following parts: Component Storage: The storage state related to the logic of the component itself, these states do not need to be exposed to the outside Component Message: The externally-facing Message of the component Component Event: The event that the component's own logic will emit Component internal interface: an interface for other logic in the contract to call For example, common Ownable contracts: abstract contract Ownable is Context { // Component Storage address private _owner; // Component Event event OwnershipTransferred( address indexed previousOwner, address indexed newOwner ); // Component internal interface modifier onlyOwner() { ... } // Component Event function renounceOwnership() public virtual onlyOwner { ... } ...
} If a contract needs to be Ownable, just inherit the contract: contract Escrow is Ownable {
...
} Similarly, other components can also have Ownable through inheritance: contract Pausable is Ownable { ... function unpause() public onlyOwner whenPaused { ... }
} The intention of inheritance here is actually composition rather than an is-a relationship. Although excessive use of inheritance in Solidity will cause many problems, inheritance for specific intentions is still an important way to achieve it. In contract development based on ink!, through metis, we can also achieve the same motivation based on generics and traits: ... #[metis::contract] // metis contract macro, will use ink_lang::contract auto
mod flipper { ... #[ink(storage)] #[import(ownable)] // flipper import the ownable pub struct Flipper { ownable: ownable::Data<Flipper>, // data by ownable value: bool, } #[ink(event)] #[metis(ownable)] // event in ink! will refactor pub struct OwnershipTransferred { //... } impl Flipper { //... #[ink(message)] pub fn flip(&mut self) { // check owner ownable::Impl::ensure_caller_is_owner(self); self.value = !self.value; } //... #[ink(message)] pub fn renounce_ownership(&mut self) { ownable::Impl::renounce_ownership(self) // owner message } //... }
} Metis assists developers to achieve the same function through a series of helper macros. In order to improve the auditability of the contract, here we hope that users clearly implement storage, event and message declarations. At the same time, metis has improved the implementation of components: //... // Storage
#[metis::component::storage]
pub struct Data<E>
where E: Env,
{ owner: Lazy<Option<E::AccountId>>,
} // Event trait
pub trait EventEmit<E: Env>: EnvAccess<E> { //...
} // Impl trait
pub trait Impl<E: Env>: Storage<E> + EventEmit<E> { // logics fn init(&mut self) { self.get_mut().set_ownership(&Some(Self::caller())); } fn renounce_ownership(&mut self) { self.ensure_caller_is_owner(); self.emit_event_ownership_transferred( self.get().get_ownership().clone(), None); self.get_mut().set_ownership(&None); } //... /// Panic if `owner` is not an owner fn ensure_owner(&self, owner: &E::AccountId) { assert!(&self.get().get_ownership().clone().unwrap() == owner); } //...
} Such components can extend their functions by inheriting other components, such as an ERC20 component with the function of destroying tokens: pub trait Impl<E>: erc20::Impl<E>
where E: Env,
{ fn _burn(&mut self, account: &E::AccountId, amount: E::Balance) -> Result<()> { //... } fn burn(&mut self, amount: E::Balance) -> Result<()> { self._burn(&Self::caller(), amount) } fn burn_from(&mut self, account: &E::AccountId, amount: E::Balance) -> Result<()> { //... }
} Based on metis, we can implement various contract combination modes implemented by Solidity through inheritance under limited intent, and at the same time, with the help of rust's zero-cost abstraction, these abstractions will not bring additional performance consumption.

